import React, { Component } from "react";

import { Link } from 'react-router-dom'

export default class Payment extends Component {

    render()
    {
        return <div>
            <h2>Payment Component</h2>
            <Link to="/pay"><button className="btn btn-success">Pay</button></Link>
        </div>
    }
}
